<h2>{{practice.name}}</h2>
<form name="form" class="file-upload-form">
    <div type="file" ngf-select ng-model="file" accept=".java" ngf-max-size="15KB" class="uploadFile" name="file">
        <div ng-if="!file">Select File</div>
    </div>
    <div ng-if="file">{{file.name}}</div>
    <button type="submit" ng-click="submit()">Submit</button>
</form>
<div id="ojfeedback-msg">Feedback: {{ojfeedback}}</div>
<div my-pdf-display url={{practice.pdfUrl}}></div>
